@philbooth I couldn't find the code I used for sending events in the demo integration, I think I must have deleted it :-(

Nontheless, here's a sketch of what it looked like.  Untested, but I've use this pattern successfully in the past so hopefully it can be a useful starting point.

Another option here would be to try to use some of the new async I/O stuff that's in Python 3, if it's easier to migrate this to python3 than to do a full-on port to nodejs.

